INSERT INTO `property_types` (`id`, `title`, `description`, `created_at`, `updated_at`) VALUES
(1, 'Flat', 'rom studio flats, to maisonettes and 2-storey flats, a flat is a living area that is self-contained and in one part of a building. A building is usually split into individual flats and the communal areas are those that are shared e.g. lifts, stairwel', '2020-01-08 12:55:35', '0000-00-00 00:00:00'),
(2, 'Detatched', 'Detached houses are more likely to be the property types we all dream of owning. They tend to be more private as they are single standing properties, and do not share walls with other houses. Due to its privacy, detached houses are a lot more expensi', '2020-01-08 12:55:35', '0000-00-00 00:00:00'),
(3, 'Semi-detached', 'Semi-detached properties are a lot more common for homeowners to purchase/rent. There are a lot more semi-detached properties in the UK as they save a lot of space as they are houses paired together by a common wall. Semi-detached properties are fant', '2020-01-08 12:55:35', '0000-00-00 00:00:00'),
(4, 'Terraced', 'Terraced houses are common in old industrial towns and cities such as Manchester, Bath and areas of central London. Terraced houses became extremely popular to provide high-density accommodation for the working class in the 19th century. Terraced hou', '2020-01-08 12:55:35', '0000-00-00 00:00:00'),
(5, 'End of Terrace', 'It says it in the name. It is the end of a terraced house and only one side shares a common wall, while the other is detached.', '2020-01-08 12:55:35', '0000-00-00 00:00:00'),
(6, 'Cottage', 'It says it in the name. It is the end of a terraced house and only one side shares a common wall, while the other is detached.', '2020-01-08 12:55:35', '0000-00-00 00:00:00'),
(7, 'Bungalow', 'The word ‘bungalow’, originates from the Indian word ‘Bangla’, which in the 19th century referred to houses that were built in a Bengali style. Houses that were made in Bengali style were traditionally very small and only one storey high and detached', '2020-01-08 12:55:35', '0000-00-00 00:00:00');
